import React from "react";
import classes from "./AddUserForm.module.css";

const AddUserForm = (props) => {
  return (
    <form>
      <div>
        <label>Name</label>
        <input type="text" />
      </div>
      <div>
        <label>Age</label>
        <input type="number" />
      </div>
    </form>
  );
};

export default AddUserForm;
